import React from "react";
import { Row, Col, Container, Jumbotron } from "react-bootstrap";

const StudentMatters = () => {
  let month = new Date().getMonth();
  month = month.toLocaleString("en-us", { month: "long" });
  console.log(month);

  return (
    <Container className="student-matters text-center" fluid>
      <h3 style={{ color: "white", textAlign: "left" }}>Student Matters</h3>
      <Row>
        <Col>
          <Jumbotron
            style={{
              backgroundColor: "white",
              width: "auto",
              height: "auto",
            }}
          >
            <h3>High Temperature</h3>
          </Jumbotron>
        </Col>
      </Row>
      <Row>
        <Col>
          <Jumbotron
            style={{
              backgroundColor: "white",
              width: "auto",
              height: "auto",
            }}
          >
            <h3>Low Attendance</h3>
          </Jumbotron>
        </Col>
      </Row>
    </Container>
  );
};

export default StudentMatters;
